defaultLaneIndex = 3
banrateIndex = 4
winrateIndex = 0
pickrateIndex = 1

def getWinrate(name):
	for laneNumber, lane in stats[name]["lanes"].iteritems():
		if str(laneNumber) == "0":
			return float(lane[winrateIndex])

def getPickrate(name):
	for laneNumber, lane in stats[name]["lanes"].iteritems():
		if str(laneNumber) == "0":
			return float(lane[pickrateIndex])

def getBanrate(name):
	return float(stats[name]["global"][banrateIndex])

def getPopularity(name):
	return (100 * getPickrate(name)) / (100 - getBanrate(name))

def getInfluence(name):
	return (getWinrate(name) - 50) * getPopularity(name)